const faqItems=document.querySelectorAll(".faq-item");faqItems.forEach(e=>{let t=e.querySelector(".faq-question"),r=e.querySelector(".faq-answer"),a=e.querySelector(".faq-icon");t.addEventListener("click",()=>{faqItems.forEach(e=>{let t=e.querySelector(".faq-answer"),a=e.querySelector(".faq-icon");t!==r&&(t.classList.remove("open"),a&&a.classList.remove("rotate"))}),r.classList.toggle("open"),a&&a.classList.toggle("rotate")})});